import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let model = {clicks: 0};
ReactDOM.render(<App clicks={model}/>, document.getElementById('root'));

serviceWorker.register();
